This will require writing an overlay file. And use the GPIO API. First create the file boards/ folder in a new app directory. See Installation for creating an empty app template. And in the directory create the file "stm32_min_dev_blue.overlay", with the following contents. This will be the device tree for the external button addition. / { gpio_keys { compatible = "gpio-keys"; butn: butn { label = "Key"; gpios = <&gpioa 0 GPIO_ACTIVE_LOW>; }; }; aliases { butn0 = &butn; };
}; Wire up a button to the stm32 board with a pull up resistor like this: < image for connecting button to PA0 > Using the concepts discussed above; here is the final code for button prompted blink: #include <zephyr.h>
#include <drivers/gpio.h>
#include <sys/util.h>
#include <inttypes.h> /* 1000 msec = 1 sec */
#define SLEEP_TIME_MS 1000 /* The devicetree node identifier for the "led0" alias. */
#define LED0_NODE DT_ALIAS(led0) /* * A build error on this line means your board is unsupported. * See the sample documentation for information on how to fix this. */
static const struct gpio_dt_spec led = GPIO_DT_SPEC_GET(LED0_NODE, gpios);
static const struct gpio_dt_spec specb = GPIO_DT_SPEC_GET(DT_ALIAS(butn0), gpios); void main(void)
{ int ret; if (!device_is_ready(led.port)) { return; } if (!device_is_ready(specb.port)) { return; } ret = gpio_pin_configure_dt(&led, GPIO_OUTPUT_ACTIVE); if (ret < 0) { return; } ret = gpio_pin_configure_dt(&specb, GPIO_INPUT); if (ret < 0) { return; } while (1) { if (gpio_pin_get(specb.port, specb.pin)) { gpio_pin_set(led.port, led.pin, 1); } else { gpio_pin_set(led.port, led.pin, 0); } }
} This is a very basic demonstration of push button with no debounce mechanism. The led may inadvertently toggle multiple times for a single push.

