#define LED0_NODE DT_ALIAS(led0) static const struct gpio_dt_spec led = GPIO_DT_SPEC_GET(LED0_NODE, gpios);
static const struct gpio_dt_spec specb = GPIO_DT_SPEC_GET(DT_ALIAS(butn0), gpios); static struct gpio_callback button_cb_data; void button_pressed(const struct device *dev, struct gpio_callback *cb, uint32_t pins)
{ gpio_pin_toggle_dt(&led);
} void main(void)
{ int ret; if (!device_is_ready(led.port)) { return; } if (!device_is_ready(specb.port)) { return; } ret = gpio_pin_configure_dt(&led, GPIO_OUTPUT_ACTIVE); if (ret < 0) { return; } ret = gpio_pin_configure_dt(&specb, GPIO_INPUT); if (ret < 0) { return; } ret = gpio_pin_interrupt_configure_dt(&specb, GPIO_INT_EDGE_TO_ACTIVE); if (ret != 0) { printk("Error %d: failed to configure interrupt on %s pin %d\n", ret, specb.port->name, specb.pin); return; } gpio_init_callback(&button_cb_data, button_pressed, BIT(specb.pin)); gpio_add_callback(specb.port, &button_cb_data); while (1) { }
} The above is a modified example from the samples folder 'basic->button'. It simply toggles the LED when the button is pushed.

