define MY_STACK_SIZE 500
#define MY_PRIORITY 5 extern void my_entry_point(void *, void *, void *); K_THREAD_STACK_DEFINE(my_stack_area, MY_STACK_SIZE);
struct k_thread my_thread_data; k_tid_t my_tid = k_thread_create(&my_thread_data, my_stack_area, K_THREAD_STACK_SIZEOF(my_stack_area), my_entry_point, NULL, NULL, NULL, MY_PRIORITY, 0, K_NO_WAIT); The preceding code spawns a thread immediately. We will study the arguments of the above function one at a time. &my_thread_data: my_stack_area: my_entry_point: the entry point function (user defined), that takes upto 3 arguments. It's passed 'NULL' in this example. MY_PRIORITY: the priority assigned for this thread. We will discuss priorities in detail below. timeout: the amount of time in milliseconds to wait before the kernel actually starts the thread. Here it's 'K_NO_WAIT'; ie 0.
